// lib
import React from "react";
import { createUseStyles } from "react-jss";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";

// components
// import SignIn from "../users/signIn/SignIn";
// import SignUp from "../users/signUp/SignUp";

// =================================================================
const useStyles = createUseStyles({
  headerHome: {
    padding: "0 4rem",
    backgroundColor: "var(--background-color-header)",
  },

  logo: {
    gap: "0.8rem",
    padding: "2.5rem 0",
    borderBottom: "2.3px solid rgb(255, 0, 0)",
  },
  logo__text: {
    fontSize: "2rem",
  },
  users__avt: {
    width: "5rem",
    height: "5rem",
    backgroundRepeat: "no-repeat",
    backgroundPosition: "center",
    backgroundSize: "cover",
  },

  "users-bar__hidden": {
    top: "105%",
    right: "4rem",
    minWidth: "25rem",
    fontSize: "1.4rem",
    border: "radius 0.7rem",
    color: "var(--text-color-light)",
    backgroundColor: "var(--background-color-header)",
  },

  "users-bar__hidden > *": {
    padding: "1.5rem",
  },

  settingBar: {
    cursor: "pointer",
  },
});

const HeaderUser = (props) => {
  const classes = useStyles();

  return (
    <div className="users-bar">
      <div className="users-bar__display">
        <div
          className={classes.users__avt + 'rounded-circle'}
          style={{
            backgroundImage:
              "url(" +
              "https://www.kindpng.com/picc/m/78-786207_user-avatar-png-user-avatar-icon-png-transparent.png" +
              ")",
          }}
        ></div>
      </div>

      <div className="users-bar__hidden position-absolute d-none">
        <div className="users-bar__review">
          <div className="users-bar__title">Signed in as</div>
          <div className="users-bar__fullname font-weight-bold">
            Thái Hà Nguyễn
          </div>
        </div>

        <div className="setting-bar">
          <div className="setting-bardisplay">Account Settings</div>
          <div className="setting-barhidden"></div>
        </div>

        <button
          className="signOutBtn button btn--none-border btn--full-width btn--none-radius btn--hover-bg-gray m-0 text-left "
          style={{ padding: "1.5rem" }}
        >
          Sign out
        </button>
      </div>
    </div>
  );
};

export default HeaderUser;
